    <div className="product-container">
      {products.map((product) => (
        <div key={product.id} className="product-list">
          <i>{product.title} </i>
          por {product.price}
          <img
            width="150"
            height="150"
            src={product.image}
            alt={product.category}
          />
          <Link to={`products/${product.id}`}>Ver m√°s...</Link>
        </div>
      ))}
    </div>
  );
}

export default Stock;
